import React from "react";
import Data from "./AllDeatils";

const UserDetails = () => {
  return (
    <div>
      <div className="display-1 text-danger text-center"> User Details </div>
      <div className="">
        {Data.map((elem) => (
          
          <>
          <ul>
            <li>{elem.name}</li>
            <li>{}</li>
          </ul>
          
          </>
        ))}
      </div>
    </div>
  );
};

export default UserDetails;
